obj_desc:
Комната общей площадью 23,2 кв. м. в малосемейном общежитии. В соответствии с тех. Паспортом в составе «комнаты»: 
- коридор площадью 5,3 кв.м. Выполняет также функцию кухни. Установлена раковина, стиральная машина. Приготовление пищи на электроплите (дом без газа);
-сан.узел площадью 1,7 кв.м.; установлена метровая ванна, унитаз. Сантехника новая, трубы пластиковые, новые. Отделка стен, пола – плитка, потолка – пластиковые панели;
-комната, частично разделённая перегородкой на 2 комнаты площадью 6,6 и 9,6 кв.м. Окна – 2, пластиковые стеклопакеты. Радиаторов отопления- 2. Зимой очень тепло. 
Входная дверь новая, металлическая. После продажи в комнате остаются СПЛИТ система, стиральная машинка, шкаф б/у.
